import './Post.css';
import dialogs_profile from '../../../../../images/dialogs_profile.svg'

const Post = (props) => {
	return (
		<article className='item_post'>
			<div className="item_post__image">
				<img src={dialogs_profile} alt=""/>
			</div>
			<div className="item_post__body">
				<div className="item_post__title">{ props.name }</div>
				<div className="item_post__content">
					Lorem ipsum dolor sit amet, consectetur adipisicing elit.
					Ad aliquam consequuntur dolorum expedita labore nihil non
					odit perferendis ratione, tempore?
				</div>
			</div>
		</article>
	)
}

export default Post;
